import React from 'react'
import Item from './Item'

const Basket = (props) => {
  return (
    <div>
        <div>
           {
            props.cartItems.length>0?
            <div>
                {
                     props.cartItems.map(obj =>{
                        return(
                            <Item
                            key={obj.id}
                            id={obj.id}
                            myId={obj.myId}
                            title={obj.title}
                            description={obj.description}
                            price={obj.price}
                            img={obj.img}
                            deletItem={props.deleteItems}
                            />
                        )
                     })
                }
                </div>
                : <h1>Корзина пуста</h1>
           }
           <div className='row'>
            <div className='col-md-8 offset-md-2'>
                <p>Итог:</p>
                <p>{props.totalPrice}</p>
                <button type='button' className=' w-100 btn-lg btn btn-primary'>Забронировать</button>

            </div>
           </div>
        </div>
    </div>
  )
}

export default Basket
